  true,\n\t\"url\": null,\n\t\"notes\": \"The Carl D. Perkins Career and Technical
  Education Act of 2006 Consolidated Annual Report, 2008-09 (Perkins IV CAR 2008-09),
  is part of the Carl D. Perkins Career and Technical Education Act of 2006 Consolidated
  Annual Report (CAR) program; program data is available since 2001 at <http://cte.ed.gov/accountability/reports.cfm>
  where are manipulable data exist for different years. Perkins IV CAR 2008-09 (http://cte.ed.gov/accountability/reports.cfm)
  is a cross-sectional survey that states submit to the Department with annual enrollment,
  financial and performance data on their progress in achieving state levels of performance
  on the core indicators of Carl D. Perkins Career and Technical Education Act of
  2006 (Perkins IV) funding for career and technical education. The study was conducted
  using web-based forms, excel spreadsheets, or paper forms of each eligible agency
  that receives Perkins IV funding, including the 50 United States, the District of
  Columbia, Puerto Rico, the U.S. Virgin Islands, the Republic of Palau, and Guam.
  Perkins IV CAR 2008-09 is a universe survey.  Key statistics produced from the Perkins
  IV CAR 2008-09 are state narratives and financial data, enrollment in career and
  technical education programs, and state performance in meeting Perkins IV core indicators.\",\n\t\"owner_org\":
